// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract DonationTracker {
    struct Donation {
        address donor;
        uint256 amount;
        string name;
        string message;
        uint256 timestamp;
    }

    mapping(address => Donation[]) private donationsReceived;
    mapping(address => uint256) private balances;

    event DonationMade(
        address indexed donor,
        address indexed recipient,
        uint256 amount,
        string name,
        string message
    );
    event Withdrawal(address indexed recipient, uint256 amount);

    function donate(
        address recipient,
        string memory donorName,
        string memory donorMessage
    ) external payable {
        require(msg.value > 0, "Donation must be greater than zero");
        donationsReceived[recipient].push(
            Donation({
                donor: msg.sender,
                amount: msg.value,
                name: donorName,
                message: donorMessage,
                timestamp: block.timestamp
            })
        );
        balances[recipient] += msg.value;
        emit DonationMade(msg.sender, recipient, msg.value, donorName, donorMessage);
    }

    function withdraw() external {
        uint256 amount = balances[msg.sender];
        require(amount > 0, "No funds to withdraw");
        balances[msg.sender] = 0;
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Withdraw failed");
        emit Withdrawal(msg.sender, amount);
    }

    function getDonationHistory(address recipient) external view returns (Donation[] memory) {
        return donationsReceived[recipient];
    }

    function getBalance(address recipient) external view returns (uint256) {
        return balances[recipient];
    }
}

